function SignUpBtn(props) {
  return ReactDom.createPortal(
    <button
      className="main-header-buttons"
      id="sign-up-button"
      onClick={props.openedTunnel2}
    >
      <strong>SIGN UP</strong>
    </button>
  );
}

export default SignUpBtn;
